Map:
Displays maps and information for a specified map with buttons for additional information at the bottom.

**E.g.** </map:1067035934073290796> {Customs/Factory/etc.}
(*{} are require, [] are optional*)

Tk Edit:
Edit your guilds team kills.

**E.g.** </tk edit:1067035934073290800> {@ID} {Description/Video} {New Value}
(*{} are required, [] are optional*)

Tk List:
Display a members team kills.

**E.g.** </tk list:1067035934303989850> {@User}
(*{} are required)

Tk Remove:
Remove a team kill from someones list.
To get a team kill ID use /tk list {@User}

**E.g.** </tk remove:1067035934303989852> {@ID}
(*{} are required*)
